  protected override void DoAction(int action)
  {
    switch (action)
    {
      case 2: // program -> import_clause, decl_and_stmt_list, optional_semicolon
{
			// main program
			if (!is_unit_to_be_parsed) {
				var ul = ValueStack[ValueStack.Depth-3].stn as uses_list;
				var stl = ValueStack[ValueStack.Depth-2].stn as statement_list;
				stl.left_logical_bracket = new token_info("");
				stl.right_logical_bracket = new token_info("");
				var bl = new block(decl, stl, LocationStack[LocationStack.Depth-2]);
				decl.AddFirst(decl_forward.defs);
				root = CurrentSemanticValue.stn = NewProgramModule(null, null, ul, bl, ValueStack[ValueStack.Depth-1].ob, CurrentLocationSpan);
				root.source_context = bl.source_context;
			}
			// unit
			else {
				decl.AddFirst(decl_forward.defs);
				var interface_part = new interface_node(decl as declarations, ValueStack[ValueStack.Depth-3].stn as uses_list, null, null);
				var initialization_part = new initfinal_part(null, ValueStack[ValueStack.Depth-2].stn as statement_list, null, null, null, CurrentLocationSpan);

				root = CurrentSemanticValue.stn = new unit_module(
					new unit_name(new ident(Path.GetFileNameWithoutExtension(parsertools.CurrentFileName)),
					UnitHeaderKeyword.Unit, CurrentLocationSpan), interface_part, null,
					initialization_part.initialization_sect,
					initialization_part.finalization_sect, null, CurrentLocationSpan);
			}

		}
        break;
      case 3: // import_clause -> /* empty */
{
			CurrentSemanticValue.stn = null;
		}
        break;
      case 4: // import_clause -> import_clause, import_clause_one
{
   			if (parsertools.build_tree_for_formatter)
   			{
	        	if (ValueStack[ValueStack.Depth-2].stn == null)
                {
	        		CurrentSemanticValue.stn = new uses_closure(ValueStack[ValueStack.Depth-1].stn as uses_list,CurrentLocationSpan);
                }
	        	else {
                    (ValueStack[ValueStack.Depth-2].stn as uses_closure).AddUsesList(ValueStack[ValueStack.Depth-1].stn as uses_list,CurrentLocationSpan);
                    CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-2].stn;
                }
   			}
   			else
   			{
	        	if (ValueStack[ValueStack.Depth-2].stn == null)
                {
                    CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn;
                    CurrentSemanticValue.stn.source_context = CurrentLocationSpan;
                }
	        	else
                {
                    (ValueStack[ValueStack.Depth-2].stn as uses_list).AddUsesList(ValueStack[ValueStack.Depth-1].stn as uses_list,CurrentLocationSpan);
                    CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-2].stn;
                    CurrentSemanticValue.stn.source_context = CurrentLocationSpan;
                }
			}
		}
        break;
      case 5: // import_clause_one -> IMPORT, ident, SEMICOLON
{
			CurrentSemanticValue.stn = new uses_list(new unit_or_namespace(new ident_list(ValueStack[ValueStack.Depth-2].id as ident, LocationStack[LocationStack.Depth-2]), LocationStack[LocationStack.Depth-2]),LocationStack[LocationStack.Depth-2]);
			CurrentSemanticValue.stn.source_context = CurrentLocationSpan;
		}
        break;
      case 6: // decl_or_stmt -> stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 7: // decl_or_stmt -> decl
{ CurrentSemanticValue.stn = null; }
        break;
      case 8: // decl -> proc_func_decl
{
			CurrentSemanticValue.stn = null;
			decl.Add(ValueStack[ValueStack.Depth-1].stn as procedure_definition, CurrentLocationSpan);
		}
        break;
      case 9: // decl_and_stmt_list -> decl_or_stmt
{
			if (ValueStack[ValueStack.Depth-1].stn is statement st)
				CurrentSemanticValue.stn = new statement_list(ValueStack[ValueStack.Depth-1].stn as statement, LocationStack[LocationStack.Depth-1]);
			else
				CurrentSemanticValue.stn =  new statement_list();
		}
        break;
      case 10: // decl_and_stmt_list -> decl_and_stmt_list, SEMICOLON, decl_or_stmt
{
			if (ValueStack[ValueStack.Depth-1].stn is statement st)
				CurrentSemanticValue.stn = (ValueStack[ValueStack.Depth-3].stn as statement_list).Add(st, CurrentLocationSpan);
			else
				CurrentSemanticValue.stn = (ValueStack[ValueStack.Depth-3].stn as statement_list);
		}
        break;
      case 11: // stmt_list -> stmt
{
			CurrentSemanticValue.stn = new statement_list(ValueStack[ValueStack.Depth-1].stn as statement, LocationStack[LocationStack.Depth-1]);
		}
        break;
      case 12: // stmt_list -> stmt_list, SEMICOLON, stmt
{
			CurrentSemanticValue.stn = (ValueStack[ValueStack.Depth-3].stn as statement_list).Add(ValueStack[ValueStack.Depth-1].stn as statement, CurrentLocationSpan);
		}
        break;
      case 13: // stmt -> assign_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 14: // stmt -> if_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 15: // stmt -> proc_func_call_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 16: // stmt -> while_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 17: // stmt -> for_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 18: // stmt -> return_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 19: // stmt -> break_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 20: // stmt -> continue_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 21: // stmt -> global_stmt
{ CurrentSemanticValue.stn = ValueStack[ValueStack.Depth-1].stn; }
        break;
      case 22: // global_stmt -> GLOBAL, dotted_ident_list
{
			foreach (var id in (ValueStack[ValueStack.Depth-1].stn as ident_list).idents) {
				// Ð¸Ð¼Ñ Ð¿Ð°Ñ?Ð°Ð¼ÐµÑ?Ñ?Ð° ÑÐ¾Ð²Ð¿Ð°Ð´Ð°ÐµÑ? Ñ Ð¸Ð¼ÐµÐ½ÐµÐ¼ Ð³Ð»Ð¾Ð±Ð°Ð»Ñ?Ð½Ð¾Ð¹ Ð¿ÐµÑ?ÐµÐ¼ÐµÐ½Ð½Ð¾Ð¹
				if (symbolTable.Contains(id.name)) {
					parsertools.AddErrorFromResource("GLOBAL_VAR_{0}_SIM_PARAMETER", CurrentLocationSpan, id.name);
					CurrentSemanticValue.stn = null;
				}
				// Ð²ÑÑ? Ð¾Ñ?Ð»Ð¸Ñ?Ð½Ð¾!
				else {
					symbolTable.Add(id.name);
					CurrentSemanticValue.stn = new empty_statement();
					CurrentSemanticValue.stn.source_context = null;
				}
			}
		}
        break;
      case 23: // ident -> ID
{
			if (ValueStack[ValueStack.Depth-1].id.name == "result")
				ValueStack[ValueStack.Depth-1].id.name = "%result";

			CurrentSemanticValue.id = ValueStack[ValueStack.Depth-1].id;
		}
        break;
      case 24: // dotted_ident -> ident
{ CurrentSemanticValue.id = ValueStack[ValueStack.Depth-1].id; }
        break;
      case 25: // dotted_ident -> dotted_ident, DOT, ident
{
			CurrentSemanticValue.id = new ident(ValueStack[ValueStack.Depth-3].id.name + "." + ValueStack[ValueStack.Depth-1].id.name);
		}
        break;
      case 26: // dotted_ident_list -> dotted_ident
{
			CurrentSemanticValue.stn = new ident_list(ValueStack[ValueStack.Depth-1].id, CurrentLocationSpan);
		}
        break;
      case 27: // dotted_ident_list -> dotted_ident_list, COMMA, dotted_ident
{
			CurrentSemanticValue.stn = (ValueStack[ValueStack.Depth-3].stn as ident_list).Add(ValueStack[ValueStack.Depth-1].id, CurrentLocationSpan);
		}
        break;
      case 28: // assign_stmt -> variable, optional_type, ASSIGN, expr
{
			if (ValueStack[ValueStack.Depth-4].ex is ident id) {
				// Ð¾Ð±Ñ?ÑÐ²Ð»ÐµÐ½Ð¸Ðµ
				if (ValueStack[ValueStack.Depth-3].td != null || (!symbolTable.Contains(id.name) && (isInsideFunction || !globalVariables.Contains(id.name)))) {

					// Ð¾Ð±Ñ?ÑÐ²Ð»ÐµÐ½Ð¸Ðµ Ð³Ð»Ð¾Ð±Ð°Ð»Ñ?Ð½Ð¾Ð¹ Ð¿ÐµÑ?ÐµÐ¼ÐµÐ½Ð½Ð¾Ð¹
					if (symbolTable.OuterScope == null) {
						if (globalVariables.Contains(id.name)) {
							parsertools.AddErrorFromResource("This variable is declared before", CurrentLocationSpan);
						}
						else {
							var ass = new assign(id as addressed_value, ValueStack[ValueStack.Depth-1].ex, ValueStack[ValueStack.Depth-2].op.type, CurrentLocationSpan);
							globalVariables.Add(id.name);

							type_definition ntr;

							if (ValueStack[ValueStack.Depth-3].td == null) {
								// ntr = new named_type_reference(new ident("integer"));
								ntr = (new same_type_node(ValueStack[ValueStack.Depth-1].ex) as type_definition);
								ass.first_assignment_defines_type = true;
							}
							else ntr = ValueStack[ValueStack.Depth-3].td as type_definition;

							var vds = new var_def_statement(new ident_list(id, LocationStack[LocationStack.Depth-4]), ntr, null, definition_attribute.None, false, CurrentLocationSpan);
							decl.Add(new variable_definitions(vds, CurrentLocationSpan), CurrentLocationSpan);
							CurrentSemanticValue.stn = ass;
						}
					}
					// Ð¾Ð±Ñ?ÑÐ²Ð»ÐµÐ½Ð¸Ðµ Ð»Ð¾ÐºÐ°Ð»Ñ?Ð½Ð¾Ð¹ Ð¿ÐµÑ?ÐµÐ¼ÐµÐ½Ð½Ð¾Ð¹
					else {
						var vds = new var_def_statement(new ident_list(id, LocationStack[LocationStack.Depth-4]), ValueStack[ValueStack.Depth-3].td, ValueStack[ValueStack.Depth-1].ex, definition_attribute.None, false, CurrentLocationSpan);
						symbolTable.Add(id.name);
						CurrentSemanticValue.stn = new var_statement(vds, CurrentLocationSpan);
					}
				}
				// Ð¿Ñ?Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ðµ
				else {
					CurrentSemanticValue.stn = new assign(id as addressed_value, ValueStack[ValueStack.Depth-1].ex, ValueStack[ValueStack.Depth-2].op.type, CurrentLocationSpan);
				}
			}
			else {
				CurrentSemanticValue.stn = new assign(ValueStack[ValueStack.Depth-4].ex as addressed_value, ValueStack[ValueStack.Depth-1].ex, ValueStack[ValueStack.Depth-2].op.type, CurrentLocationSpan);
			}
		}
        break;
      case 29: // assign_stmt -> variable, assign_type, expr
{
			if (!(ValueStack[ValueStack.Depth-3].ex is addressed_value))
        		parsertools.AddErrorFromResource("LEFT_SIDE_CANNOT_BE_ASSIGNED_TO",CurrentLocationSpan);
			CurrentSemanticValue.stn = new assign(ValueStack[ValueStack.Depth-3].ex as addressed_value, ValueStack[ValueStack.Depth-1].ex, ValueStack[ValueStack.Depth-2].op.type, CurrentLocationSpan);
		}
        break;
      case 30: // assign_type -> PLUSEQUAL
{ CurrentSemanticValue.op = ValueStack[ValueStack.Depth-1].op; }
        break;
      case 31: // assign_type -> MINUSEQUAL
{ CurrentSemanticValue.op = ValueStack[ValueStack.Depth-1].op; }
